import React from 'react';
import { useRouter } from 'next/router'

const Note = () => {
  const router = useRouter();
  //this id will be matching the [id] from the file name
  const { id } = router.query;

  return (
    <h1>
      Note {id}
    </h1>
  )
}

export default Note;
